import axios from "axios";
const API =
  "http://api.rawg.io/api/games?key=84848d7503e94665adfaf7330e3f25ff";

function App() {
  const [videoGames, setVideoGames] = useState([])
  const getVideogames = async () => {
    const {data} = await axios.get(`${API}`);
console.log(data.results);
    setVideoGames(data.results)
  };

  useEffect(() => {
    getVideogames();
  }, [setVideoGames]);

  return (<>
    <div className="App">
      <h1>Henry Videogames</h1> 
      <ul>
               {
        videoGames?.map(game => {
          return (
           <li key={game.id}>{game}</li>
          )
        })
      }
            </ul>

    </div>
    </>
  );
}

export default App;
